class Main {
    public static void main(String[] args) {

        Solution sol = new Solution();

        long start = System.currentTimeMillis();
        pl(sol.isPalindrome("A man, a plan, a canal: Panama"));
        pl(sol.isPalindrome("race a car"));
        pl(sol.isPalindrome(" "));
        pl(sol.isPalindrome(
                ""));
        pl("Time: " + (System.currentTimeMillis() - start));
    }

    public static void pl(Object o) {
        System.out.println(o.toString());
    }
}

class Solution {
    public boolean isPalindrome(String s) {
        short i1 = -1, i2 = (short) s.length();
        while (++i1 < --i2) {

            char c1 = toLower(s.charAt(i1));
            while ((c1 < 'a' || c1 > 'z') && (c1 < '0' || c1 > '9')) {
                if (++i1 >= i2) {
                    return true;
                }
                c1 = toLower(s.charAt(i1));
            }

            char c2 = toLower(s.charAt(i2));
            while ((c2 < 'a' || c2 > 'z') && (c2 < '0' || c2 > '9')) {
                if (i1 >= --i2) {
                    return true;
                }
                c2 = toLower(s.charAt(i2));
            }

            if (c1 != c2) {
                return false;
            }
        }
        return true;
    }

    char toLower(char c) {
        return (c > 64 && c < 91) ? (char) (c + 32) : c;
    }
}